import React from "react";
import Deal_watch from "../Assets/deal-watch.png";

const Deal = () => {
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-7 border"></div>
          <div className="col-md-5 border">
            <img src={Deal_watch} alt="" className="m-md-5" />
          </div>
        </div>
      </div>
    </>
  );
};

export default Deal;
